namespace RonSijm.FluidHumidifier.Factories.Bedrock;

public class GuardrailFactory(string resourceName = null, Action<Humidifier.Bedrock.Guardrail> factoryAction = null) : ResourceFactory<Humidifier.Bedrock.Guardrail>(resourceName)
{

    internal InnerGuardrailTopicPolicyConfigFactory TopicPolicyConfigFactory { get; set; }

    internal InnerGuardrailWordPolicyConfigFactory WordPolicyConfigFactory { get; set; }

    internal InnerGuardrailContextualGroundingPolicyConfigFactory ContextualGroundingPolicyConfigFactory { get; set; }

    internal InnerGuardrailSensitiveInformationPolicyConfigFactory SensitiveInformationPolicyConfigFactory { get; set; }

    internal InnerGuardrailContentPolicyConfigFactory ContentPolicyConfigFactory { get; set; }

    protected override Humidifier.Bedrock.Guardrail Create()
    {
        var guardrailResult = CreateGuardrail();
        factoryAction?.Invoke(guardrailResult);

        return guardrailResult;
    }

    private Humidifier.Bedrock.Guardrail CreateGuardrail()
    {
        var guardrailResult = new Humidifier.Bedrock.Guardrail
        {
            GivenName = InputResourceName,
        };

        return guardrailResult;
    }
    public override void CreateChildren(Humidifier.Bedrock.Guardrail result)
    {
        base.CreateChildren(result);

        result.TopicPolicyConfig ??= TopicPolicyConfigFactory?.Build();
        result.WordPolicyConfig ??= WordPolicyConfigFactory?.Build();
        result.ContextualGroundingPolicyConfig ??= ContextualGroundingPolicyConfigFactory?.Build();
        result.SensitiveInformationPolicyConfig ??= SensitiveInformationPolicyConfigFactory?.Build();
        result.ContentPolicyConfig ??= ContentPolicyConfigFactory?.Build();
    }

} // End Of Class

